import React, { Component } from 'react';

const caculatorBtnTextArray = ['7','8','9','+','4','5','6','-','1','2','3','X','C','0','=','%']

class CaculateBtn extends Component {
  constructor(props) {
    super(props)
    this.state = {}
  }

  handleSuperShowPressedBtn = (key) => {
    console.log(key)
    super.setState({displayValue: key})

  }

  render() {
    return (
      caculatorBtnTextArray.map((value,index) => <a className="caculateBtnStyle" onClick={()=> this.handleSuperShowPressedBtn(value)} key={index}>{value}</a>)
    )
  }

}

export default CaculateBtn;
